mongodb updateMany with $in and arrayFilters<p>I have following collection structure:</p>

<pre><code>{
   _id: userId,
   posts: [{ _id: postId, views: 0 }]
}
</code></pre>

<p>My input are following:</p>

<ol>
<li>Array with user IDs</li>
<li>Array with post IDs</li>
</ol>

<p>With that information i want to increment the <code>views</code> for every user / post that matches, i have tried it like this:</p>

<pre><code>await Post.updateMany(
    {
      _id: {
        $in: userIds
      }
    },
    {
      $inc: {
        "posts.$[elem].views": 1
      }
    },
    {
      arrayFilters: [
        {
          "elem._id": {
            $in: postIds
          }
        }
      ],
      upsert: true
    }
  );
</code></pre>

<p>But i got the error: </p>

<blockquote>
  <p>The array filter for identifier 'elem' was not used in the update {
  $setOnInsert: { __v: 0 } }</p>
</blockquote>

<p>I also made sure that the IDs are ObjectIds and not strings.</p>

<p>So what did i wrong here?</p>

