How to add a `resolveType` to GraphQL?<p>I am trying to query a single MongoDB document (<code>trivia</code>) using GraphQL, but am having trouble with one of the document fields. It's the <code>trivia.rounds</code> field that should return an array of objects (either <code>LightningRound</code> or <code>MultipleChoiceRound</code>).</p>

<p><code>schema.graphql</code></p>

<pre><code>type Trivia {
  _id: String!
  createdAt: String!
  rounds: [Round]!
}

interface Round {
  type: String!
  theme: String!
  pointValue: Int!
}

type LightningRound implements Round {
  type: String!
  theme: String!
  pointValue: Int!
  questions: [LightningRoundQuestion]
}

type MultipleChoiceRound implements Round {
  type: String!
  theme: String!
  pointValue: Int!
  questions: [MultipleChoiceRoundQuestion]
}

// ...
</code></pre>

<p><code>trivia.js // resolver</code></p>

<pre><code>require('dotenv').config()
const { ObjectId } = require('mongodb')

const trivia = (app) =&gt; {
  return async (root, { _id }) =&gt; {
    return app
      .get('db')
      .collection(process.env.DB_COLLECTION_TRIVIA)
      .findOne(ObjectId(_id))
  }
}

module.exports = {
  trivia
}
</code></pre>

<p><code>graphql query</code></p>

<pre><code>query {
  trivia(_id: "5e827a4e1c9d4400009fea32") {
    _id
    createdAt
    rounds {
      __typename
      ... on MultipleChoiceRound {
        type
        theme
        }
            ... on PictureRound {
        type
        theme
        }
            ... on LightningRound {
        type
        theme
        }
    }
  }
}
</code></pre>

<p>I keep getting the error:</p>

<pre><code>"message": "Abstract type \"Round\" must resolve to an Object type at runtime for field \"Trivia.rounds\" with value { questions: [[Object], [Object]] }, received \"undefined\". Either the \"Round\" type should provide a \"resolveType\" function or each possible type should provide an \"isTypeOf\" function."
